css:
.item-views {
  background: #363636;
}
.background-tips {
  color: #b0b0b0;
}
.tree-view {
  background: #4d5052;
  color: #c7c7c7;
  font-size: 12px;
}
.tree-view .header {
  font-weight: bold;
}
.tree-view .header:before {
  width: 0;
  height: 0;
}
.tree-view .entries .header {
  font-weight: inherit;
}
.tab-bar {
  color: #c7c7c7;
  background-image: -webkit-linear-gradient(top, #4f5051, #4f4f4f);
  border-top: 1px solid #616161;
  border-bottom: 1px solid #454648;
  padding-bottom: 4px;
  display: block;
  clear: both;
}
.tab-bar .tab {
  border-right: 1px solid #343638;
  border-left: 1px solid #6e6e70;
  background: #4d5052;
  position: relative;
  padding: 4px 24px 4px 20px !important;
  border-bottom: 1px solid #343638;
}
.tab-bar .tab.active {
  background-image: -webkit-linear-gradient(top, #656565, #4f4f4f);
  border-bottom: none;
}
.tab-bar .tab .title {
  text-shadow: 0 1px #424242;
  width: 100%;
}
.tab-bar .tab .close-icon {
  position: absolute;
  top: 4px;
  right: 5px;
}
.tab-bar .tab .close-icon:before {
  font-weight: normal;
  color: #838383;
}
.status-bar {
  color: #c7c7c7;
  background: #4d5052;
}
.select-list {
  background: #4d5052;
  color: #c7c7c7;
  box-shadow: 0 7px 10px 0 rgba(0, 0, 0, 0.5);
}
.select-list .editor {
  border: 1px solid #6089a9;
  box-shadow: 0 0 5px 0 rgba(96, 137, 169, 0.5);
  border-radius: 2px;
  color: #c7c7c7;
  background: #4d5052;
  line-height: 18px;
  padding: 0 4px;
}
.select-list.from-top {
  top: 150px;
}
